import React, { useState, useEffect } from 'react';

import tidal from '../api/tidal';

const Albums = ({ selectedValue }) => {
  const [data, setData] = useState([])

  useEffect(() => {
    try {
      const res = tidal.get(`/search_artist_albums/${selectedValue.id}`)
      setData(res)
    } catch (err) {
      console.error(err)
    }
  }, [selectedValue])

  console.log(data)


  return (
    <div className='albums'>
      <pre>{JSON.stringify(selectedValue || {}, null, 2)}</pre>
    </div>
  )
}

export default Albums;
